import React, { Component } from "react";
import LoginForm from "./components/LoginForm";
import "./App.css"
import { BrowserRouter as Router, Route, Switch, Link, Redicect } from "react-router-dom";




class App extends Component {
  render() {
    return (
      <div className="App">
        <Router>
          <Route path="/" component={LoginForm} />
        </Router>
      </div>)
  }

}

export default App;
